import React from "react";

const Scholar = () => {
    return (
        <div>
            <h2>Scholarship and Awards</h2>
            <ul>
                <li><a href="https://scet.ac.in/pages/fees-structure/">Fees Structure</a></li>
                <li>Scholarships: Scholarship is a very important motivational tool for the students and it helps them in establishing strong educational background which is necessary for a great career. Through a scholarship a student can receive motivation for studies for various ways from family, school, institution, society as well as government. A scholarship has various facets, it can be in from of general education, foreign education, research fellowship, language research fellowship, talent search etc. A scholarship can be classified into three categories:
                    <ol>
                        <li><a href="https://scet.ac.in/pages/offered-by-government/">Government Scholarship</a></li>
                        <li><a href="https://scet.ac.in/pages/assistance-from-community/">Assistance from Community</a></li>
                        <li><a href="https://scet.ac.in/pages/bank-loans/">Bank Loans</a></li>
                    </ol>
                </li>
                <li><a href="https://scet.ac.in/pages/awards-at-scet/">Awards</a></li>
            </ul>
        </div>
    );
}

export default Scholar;
